<h2>List BioUML importers</h2>

<h3>Description</h3>

<p><code>biouml.importers</code> fetches the list of importers from BioUML server, these importers can be used in <code>biouml.import</code> function</p>


<h3>Usage</h3>

<pre><code class="language-R">biouml.importers()</code></pre>


<h3>Value</h3>

<p>Character vector of BioUML importers.
</p>
